import styled from 'styled-components'

export const Container = styled.div`
    margin: auto;
    display: grid;
    justify-content: Center;
`
export const Header = styled.h1`
    padding : 2rem 2rem;
    text-align: center;
`
export const Content = styled.div`
text-align: center;
flex-direction: column;
justify-content: center;
`;
